void
tozstr( char *charr12, char *zstr)
{
        int i;
        for (i=0; i<12; i++) charr12[i] = *zstr++;
        for (i=10; i>=0; i--) {
                if (charr12[i] == 32) charr12[i] = 0;
                else break;
        }
}


/* Look up a mnemonic */
int
lookup(char *mstr, uchar* n)
{        
        int i, j;
        char sstr[12];
        char cmpstr[12];
        char *s;
        int istrap;

        tozstr( sstr, mstr);

        /* Search in pre-built list */
        i=0;
        for(;;){
                if( !strcmp( strlits[i].str, sstr)){
                        *n = strlits[i].val;
                        return 0;
                }
                else
                if( !strcmp( strlits[i++].str, "*HALT*"))
                        break;
        }
        //print("'%s': not built-in\n",sstr);

        /* Search page labels
        */
        if( sstr[0]=='*') istrap = 1;
        else istrap = 0;
        for( i=0x00; i<0x80; i++){
                /* Special case: handle * prefix of TRAP call labels
                 */
                s = page[i].pagelabel;
                tozstr( cmpstr, s);
                if( !strcmp( istrap? sstr+1 : sstr, cmpstr)){
                         /* If trap reset b6-7, set b5 of i
                         */
                        *n = istrap? ((i&0x3F)|0x20)|i : i;
                        return 0;
                }
        }
        //print("'%s': not a page-label\n",sstr);

        /* Search offset labels */
        for ( i=0x00; i<0x80; i++){
                 for ( j=0; j<0x100; j++){
                        s = page[i].offs[j].offsetlabel;
                        tozstr( cmpstr, s);
                        if( !strcmp( sstr, cmpstr)){
                                *n = j;
                                return 0;
                        }
                 }
        }

        print( "'%s': ", sstr);
        return -1;
}

/* Write native dictionary */
void
writeD( struct myth_vm *vm)
{
    uchar pg, offs;

    //lookup("VTP", &pg);
    //lookup("VTO", &offs);
    pg = 0x40;
    offs = 0x00;

    uchar *ptr = &vm->ram[0][0];
    uint cursor = 256 * pg + offs;
    int i;

        i=0;
        for(;;){
            for( int j=0; j<strlen(strlits[i].str); j++){
                    *(ptr + cursor++) = strlits[i].str[j];
            }
            *(ptr + cursor++) = 0;    /*STR TERMINATOR*/
            *(ptr + cursor++) = 0x81; /*ENTRY TYPE*/
            *(ptr + cursor++) = 0;    /*UNUSED*/  
            *(ptr + cursor++) = strlits[i].val; /*DATA VALUE*/
            if( !strcmp( strlits[i++].str, "*HALT*")) break;
        }
    //vm->ram[0x7F][VTP] = cursor/256;
    //vm->ram[0x7F][VTO] = cursor%256;
}


